import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Navbar, Nav} from 'react-bootstrap';

function App() {
  return (
    <div className='App'>
      <Navbar bg="light" variant="light">
        <Container>
          <Navbar.Brand>명가수길이 디저트</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link>베스트</Nav.Link>
            <Nav.Link>케이크</Nav.Link>
            <Nav.Link>샌드위치</Nav.Link>
            <Nav.Link>디저트</Nav.Link>
            <Nav.Link>샐러드</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <div className='main-bg'></div>
      <div className='sort'>
        <button className='best'>인기순</button>
        <button>가나다순</button>
      </div>
      <div className='products'>
      <img src={process.env.PUBLIC_URL + './'} />
        <h4>상품명</h4>
        <p>상품설명</p>
      </div>

    </div>
  );
}

export default App;
